    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});

    <script>var counters = {timer: {}};
var update_timer = function(timer, force = false) {
	var secs = timer.value;

	// check if we should update timer or not
	noup = timer.div.className.match(/noupdate-\d+/);
	if (!force && noup != null) {
	  noup = parseInt(noup[0].match(/\d+$/));
	  if (secs > noup * 2 && secs % noup > 0) { return; }
	}

	// should we apply or remove warning class?
	warnwhen = timer.div.dataset.warnwhen;
	if (warnwhen && warnwhen > 0) {
	  if (secs <= warnwhen && !timer.div.classList.contains("warning")) {
	    timer.div.classList.add("warning");
	  } else if (secs > warnwhen && timer.div.classList.contains("warning")) {
	    timer.div.classList.remove("warning");
	  }
	}

  var mins = Math.floor(secs / 60); // 1 min = 60 secs
  secs -= mins * 60;

  // Update HTML
  timer.min.innerHTML = String(mins).padStart(2, 0);
  timer.sec.innerHTML = String(secs).padStart(2, 0);
}
var countdown = function (e) {
  target = e.target;
  if (target.classList.contains("countdown-digits")) {
    target = target.parentElement;
  }
  if (target.tagName == "CODE") {
    target = target.parentElement;
  }

  // Init counter
  if (!counters.timer.hasOwnProperty(target.id)) {
    counters.timer[target.id] = {};
    // Set the containers
	  counters.timer[target.id].min = target.getElementsByClassName("minutes")[0];
  	counters.timer[target.id].sec = target.getElementsByClassName("seconds")[0];
  	counters.timer[target.id].div = target;
  }

  if (!counters.timer[target.id].running) {
    if (!counters.timer[target.id].end) {
      counters.timer[target.id].end   = parseInt(counters.timer[target.id].min.innerHTML) * 60;
		  counters.timer[target.id].end  += parseInt(counters.timer[target.id].sec.innerHTML);
    }

    counters.timer[target.id].value = counters.timer[target.id].end;
    update_timer(counters.timer[target.id]);
    if (counters.ticker) counters.timer[target.id].value += 1;

    // Start if not past end date
    if (counters.timer[target.id].value > 0) {
      base_class = target.className.replace(/\s?(running|finished)/, "")
      target.className = base_class + " running";
      counters.timer[target.id].running = true;

      if (!counters.ticker) {
        counters.ticker = setInterval(counter_update_all, 1000);
      }
    }
  } else {
    // Bump timer value if running & clicked
    counters.timer[target.id].value += counter_bump_increment(counters.timer[target.id].end);
    update_timer(counters.timer[target.id], force = true);
    counters.timer[target.id].value += 1;
  }
};

var counter_bump_increment = function(val) {
  if (val <= 30) {
    return 5;
  } else if (val <= 300) {
    return 15;
  } else if (val <= 3000) {
    return 30;
  } else {
    return 60;
  }
}

var counter_update_all = function() {
  // Iterate over all running timers
  for (var i in counters.timer) {
    // Stop if passed end time
    console.log(counters.timer[i].id)
    counters.timer[i].value--;
    if (counters.timer[i].value <= 0) {
      counters.timer[i].min.innerHTML = "00";
      counters.timer[i].sec.innerHTML = "00";
      counters.timer[i].div.className = counters.timer[i].div.className.replace("running", "finished");
      counters.timer[i].running = false;
    } else {
      // Update
      update_timer(counters.timer[i]);

      // Play countdown sound if data-audio=true on container div
      let audio = counters.timer[i].div.dataset.audio
      if (audio && counters.timer[i].value == 5) {
        counter_play_sound(audio);
      }
    }
  }

  // If no more running timers, then clear ticker
  var timerIsRunning = false;
  for (var t in counters.timer) {
    timerIsRunning = timerIsRunning || counters.timer[t].running
  }
  if (!timerIsRunning) {
    clearInterval(counters.ticker);
    counters.ticker = null;
  }
}

var counter_play_sound = function(url) {
  if (typeof url === 'boolean') {
    url = 'libs/countdown/smb_stage_clear.mp3';
  }
  sound = new Audio(url);
  sound.play();
}

var counter_addEventListener = function() {
  if (!document.getElementsByClassName("countdown").length) {
    setTimeout(counter_addEventListener, 2);
    return;
  }
  var counter_divs = document.getElementsByClassName("countdown");
  console.log(counter_divs);
  for (var i = 0; i < counter_divs.length; i++) {
    counter_divs[i].addEventListener("click", countdown, false);
  }
};

counter_addEventListener();
</script>

#Fixed Acidity and Alcohol: Regression Line

* Instead of showing the mean of alcohol for all levels of fixed acidity, we can assume their underlying relationship is represented by a *shape*

* Enter *regression* aka *line-fitting*

* In basic forms of regression, this will be a *straight* line

* The equation for such a line with an intercept `\(b_0\)` and a slope `\(b_1\)` is:
    $$
    \widehat{y}_i = b\_0 + b\_1 x\_i
    $$

  * an __outcome variable__ (also called __dependent variable__):  
  *average alcohol* `\((y)\)`
  
  * an __explanatory variable__ (also called __independent variable__ or __regressor__):  
  *fixed acidity* `\((x)\)`

---

# Fixed Acidity and Alcohol: Regression Line

.pull-left[
&lt;img src=&quot;data:image/png;base64,#slides_session2_files/figure-html/unnamed-chunk-5-1.svg&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

.pull-right[

* A *line*! Great. But **which** line? This one?

* That&#39;s a *flat* line. But average alcohol is somewhat *decreasing* with fixed acidity 

* We need a rule to decide!

]

---

# Ordinary Least Squares (OLS)

* OLS gives us the line that minimizes *the sum of the squared residuals*

* The residual is the &#39;error&#39; or * vertical distance* between your line and the actual observation

&lt;iframe src=&quot;https://gustavek.shinyapps.io/reg_simple/&quot; width=&quot;100%&quot; height=&quot;400px&quot; data-external=&quot;1&quot; style=&quot;border: none;&quot;&gt;&lt;/iframe&gt;

---

# **O**rdinary **L**east **S**quares (OLS): Interpretation

For now assume both the dependent variable `\((y)\)` and the independent variable `\((x)\)` are numeric.

&gt; Intercept `\((b_0)\)`: **The predicted value of `\(y\)` `\((\widehat{y})\)` if `\(x = 0\)`.**

&gt; Slope `\((b_1)\)`: **The predicted change, on average, in the value of `\(y\)` *associated* to a one-unit increase in `\(x\)`.**

*  Note that we use the term *associated*, **clearly avoiding interpreting `\(b_1\)` as the causal impact of `\(x\)` on `\(y\)`**. To make such a claim, we need some specific conditions to be met. 

 
* Also notice that the units of `\(x\)` will matter for the interpretation (and magnitude!) of `\(b_1\)`.

* **You need to be explicit about what the unit of `\(x\)` is!**

---
# OLS with `R`

* In `R`, OLS regressions are estimated using the `lm` function.

* This is how it works:

  
  ```r
  lm(formula = dependent variable ~  independent variable, data = data.frame containing the data)
  ```

## Alcohol and Fixed Acidity

Let&#39;s estimate the following model by OLS: `\(\textrm{alcohol}_i = b_0 + b_1 \textrm{fixed acidity}_i + e_i\)`

.pull-left[

```r
# OLS regression of alcohol on fixed acidity
lm(alcohol ~ `fixed acidity`, wine) 
```
]

.pull-right[

```
## 
## Call:
## lm(formula = alcohol ~ `fixed acidity`, data = wine)
## 
## Coefficients:
##     (Intercept)  `fixed acidity`  
##        10.73701         -0.03775
```
]

---

# **O**rdinary **L**east **S**quares (OLS): Prediction


```
## 
## Call:
## lm(formula = alcohol ~ `fixed acidity`, data = wine)
## 
## Coefficients:
##     (Intercept)  `fixed acidity`  
##        10.73701         -0.03775
```

This implies (abstracting the `\(_i\)` subscript for simplicity):


$$
`\begin{aligned}
\widehat y &amp;= b_0 + b_1 x \\
\widehat {\text{alcohol}} &amp;= b_0 + b_1 \cdot \text{fixed acidity} \\
\widehat {\text{alcohol}} &amp;=  10.73701 + (-0.03775) \cdot \text{fixed acidity}
\end{aligned}`
$$

What&#39;s the predicted level of alcohol for a wine with an acidity of 10? (Using the *exact* coefficients.)

$$
`\begin{aligned}
\widehat {\text{alcohol}} &amp;= 10.73701 + (-0.03775) \cdot 10 \\
\widehat {\text{alcohol}} &amp;= 10.35951
\end{aligned}`
$$

# Multiple Regression 

* The prior examples only had one predictor. However, you can easily add more to your model. 

* This may be necessary when you need to control for confounding factors

* Or when you want to test for interaction (moderating) effects, including polynomials

# Alcohol and Fixed Acidity: Controlling for Density

Let&#39;s estimate the following model by OLS:

`\(\textrm{alcohol}_i = b_0 + b_1 \textrm{fixed acidity}_i  + b_2 \textrm{density}_i + e_i\)`



```r
# OLS regression of alcohol on fixed acidity
lm(alcohol ~ `fixed acidity` + density, wine) 
```

```

## Call:
## lm(formula = alcohol ~ `fixed acidity` + density, data = wine)
## 
## Coefficients:
##     (Intercept)  `fixed acidity`          density  
##        470.3950           0.2982        -463.9627
```

# Alcohol and Fixed Acidity: Interacting with Density

Let&#39;s estimate the following model by OLS:

`\(\textrm{alcohol}_i = b_0 + b_1 \textrm{fixed acidity}_i  + b_2 \textrm{density}_i + b_3 \textrm{fixed acidity} \cdot \textrm{density}_i + e_i\)`



```r
# OLS regression of alcohol on fixed acidity
lm(alcohol ~ `fixed acidity`*density, wine) 
```
